import { useState } from "react";
import { useEffect } from "react";

 function App() {
  const [user, setUser] = useState([]);

  const fetchdata = () => {
    fetch("https://randomuser.me/api/?results=1")
    .then(Response => Response.json())
    .then(data => setUser(data))
  }

  useEffect(() => {
    fetchdata();
  }, [])

}
 export default App;
